job_description:
* Fully work from home (Must be residentially based in NSW)
 * $750 to $830 per Day Depending on Experience;
 * Initial 12 Months + Prospect of Renewal;
 * Large Data Insight Analysis within Health Sector;
 * End User Organization;


You will be joining a large end-user organization within government and health sector.

The position is mainly focused on migrating large and complex data from Dashboards and Reports that are currently in QlikView into Power BI and later into cloud / premium versions of SQL Server and Power BI.

As such having detailed, current and hands on development across Power BI dashboards and reports, SSIS / TSQL and SSAS Cubes (Tabular cubes and DAX is preferred although multidimensional and OLAP is also accepted) is required.

Having technical experience with QlikView is NOT essential but it is desirable.

In addition to technical experience you must demonstrate immaculate communications and stakeholder management skills as some business analysis activities are also performed in this position.

The position is initially for 12 months with a good prospect for renewal, candidates must be based in NSW (regional is ok) as the position can be performed fully from home as long as you are available during the entire business day to preform the required activities.


Essential skills (must be precisely demonstrated using bullet points under each position)

 * Extensive development experience across Power BI Dashboards and Reports as well as Data Visualisation;
 * Detailed hands-on experience within SSIS ETL and/or writing stored procedures with Transact SQL to extract data from large and complex data sources, transform and load;
 * Detailed experience with SSAS cubes either multidimensional cubes and/or Tabular cubes / DAX queries;
 * Immaculate communications skills coupled with strong stakeholder management and can do attitude;

Desirable but not essential

 * Experience working with Health Related Data;
 * Experience with NSW Government organisations;


If you meet the above criteria you will need to Apply NOW in order to secure a place in the shortlist for the interviews.

Best option is to apply using the application button. You can contact us on (02) 9687 1068 for a confidential discussion. However please ensure you have sent your resume prior to making contact.

Please ensure all documents are sent in Microsoft word format.

About Us:
Step into the world of Gallagher Bassett, where risk management becomes a canvas of possibilities. Join our growing team of dedicated professionals who guide those in need to the best possible outcomes for their health and wellbeing. As a steward of trust, you'll be part of a resilient team, armed with cutting-edge technology and a relentless pursuit of a better way. Together, we will redefine the boundaries of excellence and elevate the industry to unprecedented heights. GUIDE. GUARD. GO BEYOND.


We believe that every candidate brings something special to the table, including you! So, even if you feel that you’re close but not an exact match, we encourage you to apply.
Overview:

Gallagher Bassett (GB) is Australia and New Zealand’s premier third party claims administrator. We manage claims on behalf of insurers, brokers, government bodies and self-insured organisations. We are part of the leading global risk management and insurance group Arthur J Gallagher & Co.




Life at GB is an adventure - often fast paced, unpredictable, challenging and deeply rewarding. It is social and engaging, with our unique and positive culture underpinned by The Gallagher Way – values lived daily by our people.




In addition to flexible working options, we also offer supportive learning and career pathways and provide ongoing access to training and career development. We invest in our people through strong succession planning and have a number of mentoring and training programs available.




There are some great things happening at GB as we move through a period of exciting period of transformation and change, having re-entered the NSW workers compensation market in 2023 and continuing to grow. And, we want YOU to be a part of it all!


We are seeking a dynamic, driven and experienced Performance and Insights Analyst to join our Nominal Insurer function in NSW, which delivers claims management services to injured workers and insured clients.


Reporting to the Manager, Performance and Insights, this role provides a unique opportunity to partake in a wide variety of operational initiatives, work with a range of stakeholders, and grow your career in an exciting direction. In our expansion as a 2023 start up and disruptor to the current market, you will lend your experience to support and drive the performance of our function and ultimately the success of our service offerings to injured workers and clients.


You will provide technical, statistical and strategic analysis of claims, industry and scheme data and ongoing review of business process to the NI NSW Workers Compensation. This information will be utilised to mine data, establish and analyse trends for the management team to make informed decisions and maximize performance and productivity of claims operations.
Responsibilities:
 * Support the design and delivery of key performance measure strategies and initiatives to ensure targets are achieved;
 * Identify trends and themes, communicating actionable insights to the business;
 * Contribute to the development and monitoring of reporting suites and dashboards;
 * Coach and support claims management personnel to reach optimal performance outcomes and compliance measures;
 * Collaborate with Performance and Insights, Customer Experience and Claims teams around the development of customer-centric initiatives and strategy;
 * Mentor staff to develop analytical skills and the use of job aids to maximise performance;
 * Participate in broader key business projects and initiatives.

Qualifications:
 * Previous experience in a similar role, such as customer insights or performance analytics. Industry experience in insurance or financial services, particularly claims, would be highly regarded;
 * Significant experience in the use of Power BI and Excel is essential, with additional exposure to CRMs such as Salesforce would be advantageous;
 * Demonstrated experience in managing performance through quantitative and qualitative metrics;
 * Proactive, with exceptional time management and organisational skills;
 * Excellent attention to detail;
 * Highly developed communication skills, with the ability to engage and coach at all levels of organisation;
 * A strategic mindset and approach to work;
 * A strong sense of team and collaboration;
 * A resilient attitude.

* Highly reputed financial services organisation
 * Career development opportunities | MEL CBD
 * Inclusive, collaborative, and flexible environment


ABOUT THE COMPANY

Our client is an established central financial services authority providing their clients with the highest quality transactional and advisory services. This organisation has demonstrated through consistently top decile engagement scores that they believe in investing in people for long-term development and are an organisation that operates itself based on integrity and professionalism.

This critical position will see you reporting to the Head of Risk Operations to assist with managing daily operational and risk data activities in collaboration with the wider team.

ABOUT THE ROLE

The key focus of this role will be to provide transactional support services and uplifting the data management and risk reporting capability across the organisation by utilising programming tools (such as Python) and employing business intelligence tools (such as Power BI, Tableau etc.). The successful candidate will ideally come from a financial services organisation where they have had exposure working with or alongside a credit/market/liquidity risk team and understand the application of their data analysis within a funds management ecosystem.

KEY RESPONSIBILITIES

 * Deliver data management transaction support, risk reporting, risk dashboard development and risk insights;
 * Manage data for client onboarding, and provide quality data models, analytical capabilities and business solutions across risk and the wider business;
 * Create and complete credit risk reviews and portfolio analytics, and provide support to all Anti Money Laundering/ Counter Terrorism Financing (AML/CTF) tasks within the client onboarding workflow;
 * Analyse organisational performance of financial, risk and compliance, and operational KPIs; ensuring it is compliant with regulatory, legal, prudential, and policy obligations; AND
 * Effectively liaise with a variety of internal and external stakeholders to ensure seamless delivery of the organisation’s products and services.


IDEAL CANDIDATE

 * Essential tertiary qualifications within Business, Commerce, Finance or relevant field;
 * Ideally has 2-3 years of risk or data analytics experience within financial services;
 * Demonstrated experience and understanding of financial markets products, and credit risk management techniques preferred;
 * Solid understanding of data modelling, treasury, market, and liquidity risks;
 * Strong systems experience and capability is essential with business intelligence (PowerBI, Tableu or Yellowfin, etc) and programming tools (R, Python);
 * Excellent communication and stakeholder management skills; AND
 * Highly adaptable, attentive to detail, and an ability to operate effectively under pressure.

Notably, you must be able to align with company values and culture, possess a strong work ethic and deliver to tight deadlines while maintaining standards and quality.

This is an outstanding opportunity for a growing financial services risk professional to join a well-regarded organisation, with a close-knit and collaborative work environment. Your deep data analysis skills will help the firm uplift capability and continue to transform for years to come. If you are interested in learning more about this position, please apply directly to the link or contact Fina Halim at Kaizen Recruitment on 0412 123 682.
