BetMakers Technology Group Ltd (ASX: BET) is the leading software development company for sports and racing solutions with a global footprint. With an ambitious vision and offices across the globe, BetMakers Technology Group is a technology and data partner for the world's most recognised and respected bookmakers and rights holders. We design and develop leading edge odds comparisons and intelligent betting platforms, as well as analytics and trading solutions.




We are focused on providing an environment where everyone can be themselves and can shape their careers. We encourage everyone to tackle new projects to learn and grow, whilst having the confidence to offer new insights or ideas to improve themselves and the Company without a fear of failure.





As industry leaders, with our customers at front of mind, we pride ourselves on our passionate and innovative culture. If you're ready to take your career to new heights apply now!




Do you have a passion for sports? Your future career awaits!

As a Junior Risk Analyst, you will for responsible for client profiling, servicing our Managed Trading Service Risk product, and providing data insights to help shape our Trading strategy.

This position is based in our Melbourne office offering a hybrid work arrangement that allows you to work from home a few days a week. As a requirement of the role, you will need to work flexible hours, including evenings and weekends in accordance with sports and racing events.




What you'll love about BetMakers:

 * You will be joining a dynamic group of people, committed to continuous development whilst delivering a positive team culture and employee experience.

 * Flexible working arrangements with a hybrid working model and a central CBD office location.
 * Highly competitive short term incentive plan, with attractive bonus entitlements;
 * Bespoke learning management system and study support options;
 * Regular social events, team building, birthdays, and baby showers; and
 * Comprehensive EAP, health checks and wellbeing initiatives.




To be successful in this role, you will need:

 * An interest in all things sport and racing;

 * Strong numerical and analytical skills.
 * The ability to draw sound conclusions from data insights;
 * Drive to provide excellent products and services;
 * High attention to detail;
 * The ability to work quickly and accurately under pressure;

 * Strong proactive problem-solving and decision-making skills;




Your day-to-day will involve:

 * Ensuring the Risk Management services provided to our MTS clients is the best in-class service;
 * Use trading data to provide analytics and insights to make informed, data-driven recommendations and decisions around price competitiveness and pricing strategies;
 * Providing insights and reporting to key stakeholders to a high quality standard within a timely manner;


 * Provide strategic suggestions and insights to relevant stakeholders;
 * Liaise with external and internal stakeholders as required




Your future awaits! To learn more about who BetMakers are and the work we do, please visit: www.betmakers.com, or apply now via the link below.




BetMakers is proud to be a 2024 Circle Back Initiative Employer and we commit to respond to every applicant.




BetMakers Technology Group is an inclusive employer, committed to providing a safe workforce environment and encouraging applications from candidates of all backgrounds. We value people of all abilities and diversity of culture, faith, gender identity and sexual orientation. We welcome unique contributions and perspectives of all people to ensure our workforce is representative of the world we work with and live in.
